void initTestMapBG(BG_object2Layers* bg)
{
	u16 *screntryBG0 = &SCR_ENTRY->entry[16];
	u16 *screntryBG1 = &SCR_ENTRY->entry[17];
	s32 i;
	
	bg->xScroll_MAX = TILEWIDTH*testmap_width - GBASCREENWIDTH;
	bg->yScroll_MAX = TILEHEIGHT*testmap_height - GBASCREENHEIGHT;
	
	bg->BG0 = testmap_mapEntry[0];
	bg->BG1 = testmap_mapEntry[1];
	bg->width = testmap_width;
	bg->height = testmap_height;
	//padding for collision width
	bg->collisionWidth = (testmap_width>>3);
	if((testmap_width&7) > 0)
		bg->collisionWidth += 1;
	bg->collision = testmap_collisionEntry;
	
	//check sizeof() this?
	dma3_cpy16(PALETTE_MEMORY_BG, testmap_pal,sizeof(testmap_pal));
	dma3_cpy32(&VRAM->block[0].tile[0],testmap_tiles,sizeof(testmap_tiles));
	
	for(i = 0; i<32; i++)
	{
		dma3_cpy16(screntryBG0 + i*32,&bg->BG0[i*bg->width], 32);
		dma3_cpy16(screntryBG1 + i*32,&bg->BG1[i*bg->width], 32);
	}

//This will not change so it should be placed elswhere
//in an initialization process maybe
	bg->CNT0 = BG_PRIO(2)|BG_CBB(0)|BG_SBB(16)|BG_SIZE(0);
	bg->CNT1 = BG_PRIO(3)|BG_CBB(0)|BG_SBB(17)|BG_SIZE(0);
	
	bg->H0 = 0;
	bg->V0 = 0;
	bg->H1 = 0;
	bg->V1 = 0;

	//copy CNT0 - V3 into memory
	dma3_cpy16(REG_BG_CNT0, bg, 12);
}

